import React from 'react'

const Employees = ({ employees }) => {
  return (
    <div>
      <center><h1>Employee List</h1></center>
      {employees.map((employee) => (
        <div key={employee.code} class="card">
          <div class="card-body">
            <div class="card-title">{employee.name}</div>
            <div class="card-subtitle mb-2 text-muted">{employee.age}</div>
            <p class="card-text">{employee.address}</p>
            <p class="card-text">{employee.department}</p>
          </div>
        </div>
      ))}
    </div>
  )
};

export default Employees
